import React from "react";
import { Switch, Route } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

import College from "./components/colleges";
import CollegesList from "./components/colleges-list";
import Dashboard from "./components/dashboard";
// import Login from "./components/login";


import {Line} from 'react-chartjs-2';

const state = {
  labels: ['January', 'February', 'March',
           'April', 'May'],
  datasets: [
    {
      label: 'Rainfall',
      fill: false,
      lineTension: 0.5,
      backgroundColor: 'rgba(75,192,192,1)',
      borderColor: 'rgba(0,0,0,1)',
      borderWidth: 2,
      data: [65, 59, 80, 81, 56]
    }
  ]
}


function App() {





  return (
    <div>
      <nav className="navbar navbar-expand navbar-dark bg-dark" >
      <ul class="nav nav-justified">
        <a href="/colleges" className="navbar-brand"  >
        Top Colleges in India
        </a>
      </ul>
        <div className="navbar-nav mr-auto">
          <li className="nav-item">
            <Link to={"/colleges"} className="nav-link">
              Colleges
            </Link>
          </li>

          <li className="nav-item" >
            <Link to={"/dashboards"} className="nav-link">
              Dashboard
            </Link>

          </li>
        </div>
      </nav>

      <div className="container mt-3">
        <Switch>
          <Route exact path={["/", "/colleges"]} component={CollegesList} />
          <Route 
            path="/colleges/:id"
            render={(props) => (
              <College {...props}  />
            )}
          />
          <Route path = {"/dashboards"} component={Dashboard} />
        </Switch>
      </div>

      {/* <div>
        <Line
          data={state}
          options={{
            title:{
              display:true,
              text:'Average Rainfall per month',
              fontSize:20
            },
            legend:{
              display:true,
              position:'right'
            }
          }}
        />
      </div> */}


    </div>

  );
}

export default App;
